(191, '2024-06-08', '2024-06-08', 119, 'NOVO WHATS', NULL, NULL, NULL, '     Tem como objetivo sanar as deficiencias que o whatsapp não consegue na comunicações com o cliente no suporte e nos erros impostos pelos cliente. O foco é criar um aplicativo de mensagens instantâneas responsivo, adicionar uma IA para monitorar mensagens,  responder automaticamente quando o suporte  não responder dentro de um determinado tempo. Além disso, enviar alertas e colocá-los no topo da lista de mensagens, enquanto não responderem ou não fornecer o suporte necessário para esse cliente. Também, criar um ambiente responsivo onde áudios, vídeos e imagens, podendo ser enviados e baixados, para facilitar a comunicação com o cliente.\r\n    ', 1, 'N', 'N', '2024-06-08', NULL, 0, NULL),
